from typing import List, Any, Dictfrom sqlalchemy.exc import SQLAlchemyErrorfrom sqlalchemy.ext.asyncio import AsyncSessionclass BaseDAO:    model = None    @classmethod    async def add_one(cls, session: AsyncSession, **values):        new_user = cls.model(**values)        session.add(new_user)        try:            await session.commit()        except SQLAlchemyError as Er:            await session.rollback()            raise Er        return new_userотлолтолтл    @classmethod    async def add_many(cls, session: AsyncSession, instances: List[Dict[str, Any]]):        new_users = [cls.model(**values) for values in instances]        session.add_all(new_users)        try:            await session.commit()        except SQLAlchemyError as Er:            await session.rollback()            raise Er        return new_users    